import React from "react";

export default function PlaylistComponent(props) {
  return (
    <div>
      <div class="w-[150px] rounded-xl border border-gray-100 p-4 shadow-sm hover:border-gray-200 hover:ring-1 hover:ring-gray-200 focus:outline-none focus:ring">
        <h2 class="mt-2 font-bold">{props.name}</h2>

        <p class="hidden sm:mt-1 sm:block sm:text-sm sm:text-gray-600">
          {props.description}
        </p>
      </div>
    </div>
  );
}
